import React from "react";
import { Redirect } from "react-router-dom";
import {
  DashboardContainer,
  Dashboard,
  DashBoardContent,
  DashboardList,
  DashboardListItem,
  Listh,
} from "./AdminProfileElements.js";
import { BiPackage } from "react-icons/bi";
import { FaUserFriends } from "react-icons/fa";

export const AdminProfile = ({ authorized }) => {
  if (!authorized) {
    return <Redirect to="/LogIn" />;
  }

  const nom = localStorage.getItem("nom");
  const prenom = localStorage.getItem("prenom");
  return (
    <DashboardContainer>
      <h1>
        Bienvenue {nom} {prenom}
      </h1>
      <Dashboard>
        <DashboardList>
          <DashboardListItem>
            <BiPackage size="32" />
            <Listh>Gestion des produits</Listh>
          </DashboardListItem>
          <DashboardListItem>
            <FaUserFriends size="32" />
            Gestion des utilisateurs
          </DashboardListItem>
        </DashboardList>

        <DashBoardContent>Gestion Produit</DashBoardContent>
      </Dashboard>
    </DashboardContainer>
  );
};
export default AdminProfile;
